    public static boolean findPrefix(String s, int idx, int len, Map<String,Integer> wordFreq ) {
        if ( wordFreq.size() == 0 ) return true;
        if ( idx + len > s.length() ) return false;

        String word = s.substring(idx,idx+len);
        Integer freq = wordFreq.get(word);
        if ( freq == null ) return false;
        else if ( freq == 1 ) wordFreq.remove(word);
        else wordFreq.put(word,freq-1);
        return findPrefix( s,idx+ len, len, wordFreq);
    }

    public static List<Integer> findSubstring(String s, String[] words) {
        final List<Integer> l = new ArrayList<>();
        if ( words.length == 0 ) return l;
        final int len = words[0].length();
        Map<String,Integer> wordFreq = new HashMap<>();
        for (String word: words){
            wordFreq.put(word,wordFreq.getOrDefault(word,0)+1);
        }
        Set<String> visited = new HashSet<>();
        for ( String word: words ){
            if ( !visited.contains(word) ){
                visited.add(word);
                for (int idx = -1; (idx = s.indexOf(word, idx + 1)) != -1; ) {
                    final Map<String,Integer> newWordFreq = new HashMap<>(wordFreq);
                    final Integer freq = newWordFreq.get(word);
                    if ( freq == 1 ) newWordFreq.remove(word);
                    else newWordFreq.put(word,freq-1);
                    if (findPrefix(s, idx + len, len, newWordFreq)) l.add(idx);
                }
            }
        }
        return l;
    }

